import React from 'react'
import Gasto from './Gasto'
import PropTypes from ''

export default function Listado({gastos}) {
    return (
        <div className="gastos-realizados">
            <h2>Listado</h2>
            {gastos.map(gasto=>
                <Gasto
                key={gasto.id}
                gasto={gasto}
                />
                
                
                )}
        </div>
    )
}
